INSERT INTO `card_context` VALUES ('体验人间烟火气', '去试试汪曾祺在《人间滋味》里写的：“看看生鸡活鸭、新鲜水灵的瓜菜、彤红的辣椒，热热闹闹，挨挨挤挤，让人感到一种生之乐趣。”', '人间烟火气，最抚凡人心\"越是世俗的事情，越能宽慰平凡人的心灵，讲的是一种乐观积极的生活态度。对于大部分人来说，三餐四季就是人间至美，生活往往都是越平淡越幸福。');
INSERT INTO `card_context` VALUES ('动起来吧', '停下来，简单做一组拉伸；进行30s的高抬腿；活动活动身体', '适量的运动能增加身体的血氧含量，分泌更多多巴胺，从而提升情绪状态，即便是在室内简单的动一动也能达到这样的效果噢。');
INSERT INTO `card_context` VALUES ('发现闪光点', '写出自身的闪光点，再请自己的同学/朋友/家人/恋人说出自己的三条闪光点，对比一下有哪些是自己从未意识到的优点正在闪闪发光~', '根据乔哈里视窗理论：“他人了解，但自己不了解”的部分是“盲自我”。对“盲自我”的探索，可以进一步的认识自我，发现自我，接纳自我。');
INSERT INTO `card_context` VALUES ('可控的小事', '回忆上一个困扰你的问题，写下该事件中你有把握/你能掌控的那部分内容。', '尝试掌控可控范围之外的部分而不成功常常令我们感到焦躁和痛苦，但当我们将经理和注意力分配到可控的部分时，我们可以拥有控制感。');
INSERT INTO `card_context` VALUES ('向压力说拜拜', '当你感受到压力时，请试着换一种积极的方式叙述感到压力的理由。', '以一种更积极的方式叙述压力来源，可以让我们观察到事情积极的一面，这样有助于增强做事内在动机，从而帮助我们更好地应对压力');
INSERT INTO `card_context` VALUES ('对他人的善意', '出入时请试着为后边的人扶一次门。', '扶门假设认为，每日社交礼仪（如为身后的人福门，方便Ta进出）会激发我们的内在社会合作性，还可以增加我们的心情愉悦度。');
INSERT INTO `card_context` VALUES ('幽默小事', '看看发生在别人身上有趣的事情，互相分享。（可以多多尝试漂流功能哦~）', '“幽默”可以用来帮助我们调整情绪，幽默发生时，人们往往会哈哈大笑，笑会帮助你摄入更多的氧气，使大脑释放更多血清素，而血清素是快乐源泉。“发生在他人身上的趣事”将快乐传递给屏幕前的每一位，实现快乐互传！');
INSERT INTO `card_context` VALUES ('快乐走路法', '现在昂首挺胸，趾高气昂嘚走路100米，如果现在不方便就等一会再走。', '一项研发现，仅仅通过改变走路方式，人就可以获得即刻的快乐：昂首挺胸地走路比低着头走路更能让人立刻感到快乐，不仅如此你还能从这种简单的姿势变化中感到自信。');
INSERT INTO `card_context` VALUES ('拥抱新鲜感', '尝试用一种新奇的方式做习惯的事，例如用刀叉吃饭~', '过于习惯的生活方式可能会让我们忽略事情本身的乐趣。尝试使用新奇的方法，相比于传统方法更能让我们专注当下，提升幸福感和满足感');
INSERT INTO `card_context` VALUES ('正念时刻', '泡一壶茶，在腾腾的蒸汽中细细观察茶叶在热水中慢慢舒展的样子，感受内心随着茶叶舒展也缓缓宁静下来~', '正念可以帮助我们将注意力投入在此时此地，充分的享受当下，体验生活，有助于获得更强的专注力，也可以一定程度上缓解我们的消极情绪，通过长期的正念练习，我们可以学会与情绪和谐相处，走出负面情绪的恶性循环，释放压力。');
INSERT INTO `card_context` VALUES ('温暖的抚触', '一个简单动作，能帮助你快速的的获得舒适以及被支持的感觉。\r\n请先做2-3个深呼吸，后将双手掌心相对搓热，后轻轻双手交叉叠放抚触胸口。\r\n', '通过肢体动作能立刻对身体和大脑造成影响，抚慰我们的副交感神经系统，缓和压力激素的分泌。同时身体接触能够起到抚慰人心的作用，身体的温暖也能带来内心的温暖。');
INSERT INTO `card_context` VALUES ('绿色“朋友”', '相较平时，这一次试着选择一条绿植较多的道路回家~\r\n《Scientific Reports》的一篇研究发现：经过家旁，看到路边的绿植、树木这一接触自然的行为（即使是无意识的），会降低患抑郁症的风险。\r\n相较平时，这一次试着选择一条绿植较多的道路回家~', '《Scientific Reports》的一篇研究发现：经过家旁，看到路边的绿植、树木这一接触自然的行为（即使是无意识的），会降低患抑郁症的风险。');
INSERT INTO `card_context` VALUES ('美食快乐法', '放下手头的活，去吃现在脑子里第一个迸出的易获得的美味食物。', '美味食物可激活调控情绪的中脑-边缘多巴胺神经系统，促进多巴胺释放，令人产生欣快感。正所谓这世界上没有什么是一顿美食不能解决的事，如果有，那就两顿。');
INSERT INTO `card_context` VALUES ('让你变自信的能量姿势', '坐在椅子上，将双手摆在后脑勺处，手肘打开，身体往后仰，保持这一姿势30s。', '该方法源于“具身认知”，理论指出身体状态与心理状态之间有着密切的联系。身体动作可以通过触发生理体验，从而激活心理感受。摆出开放、舒展、有力量的姿势会让人感到有力量，而这种力量感会提升人的自信水平。');
INSERT INTO `card_context` VALUES ('记录今日“小确幸”', '在手机备忘录里/本子上写一段简短的日记，不需要长篇大论，记录几条“小确幸”即可。（如：今天食堂阿姨打菜多给了几片肉！；今天的落日特别美…..）', '通过记录“每日小确幸”，不仅让我们总是对生活中的美好心怀感恩，而且让我们通过多样性的记录让自己的快乐持久。其实平凡生活的每一天，去用心地关注一些值得记录的美好记忆，也就能将更多的正能量，镌刻在每一天的结束和起始之时。');
INSERT INTO `card_context` VALUES ('记录收获', '当你完成任务、解锁某一新技能….后，开心之余，请记录下在这过程中的收获与感悟。', '人在回顾收获与成就时，会因为回想起那些瞬间而开心，也会因为更加留意生活中的好事，而增加日常的幸福感和成就感，获得动力。');
INSERT INTO `card_context` VALUES ('转换视角', '尝试换个视角思考问题，观察世界，会有许多不一样的发现与新的体会。', '美国心理学家艾里曾提出“情绪困扰”理论：引起人们情绪结果的因素往往不是事件本身，而是个人对待事件的信念、主观的片面认知，而正是这种认知才产生人们的情绪困扰。\r\n人们的烦恼和不快往往同自己看问题的角度有关，总而言之，任何事情都不是绝对的，能否战胜挫折…就看你怎么对待他，换个视角看问题，或许就能豁然开朗柳暗花明。\r\n');
INSERT INTO `card_context` VALUES ('释放小小善意', '试着向他人释放小小的善意吧，可以是一声问候、一句道谢、一次让座……', '其实一个小小的善举就可以帮助我们大大提升幸福感，我们可以通过向他人表达善意的方式获得快乐，正所谓赠人玫瑰手有余香');
INSERT INTO `card_context` VALUES ('镜子对我说', '请你走到有镜子的地方，并用让你舒服的姿势在镜子前放松下来。让我们把注意力集中在你身上那些可爱的地方:比如，你的耳朵会灵活地动，你的眼睛特别明亮，你有一颗可爱的虎牙等等。', '一个人对自己形象的评价越高，自信水平越高。对着镜子寻找自己的优点，自发地肯定自己，可以帮助你建立对身体的自信。');
